<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>WebDynamica</title>

    <style>
      .container {
	  display: block;
	  clear: both;
      }

      .render {
	  border: 1px solid black;
          box-sizing: border-box;
	  float: left;
	  aspect-ratio: 1 / 1;
      }

      .element {
	  font-size: 11px;
	  padding: 4px;
	  font-family:monospace;
	  border: 1px solid black;
      }

      .control {
	  display: flex;
	  color: #ffffc0;
	  border: 1x solid black;
	  justify-content: space-evenly;
	  background-color: #303030;
      }

      .center {
	  text-align: center;
      }

      .selectDrag {
	  color: #ff80ff;
	  font-weight: bold;
      }
      .selectSelect {
	  color: #c0c0ff;
	  font-weight: normal;
      }
      .selectDelete {
	  color: #f03030;
	  font-weight: bold;
      }
      .selectInsert {
	  color: #339e51;
	  font-weight: bold;
      }

      #canvas3d {
	  cursor: crosshair;
	  user-select: none;
	  -webkit-user-select: none;
	  -moz-user-select: none;
	  -ms-user-select: none;
	  width: 100%;
	  height: 100%;
      }

      #moleculeName {
	  font-size: 12px;
	  font-weight: bold;
	  color: #ffffff;
      }
      #alternateName {
	  font-size: 10px;
      }
      #insertName {
	  font-weight: bold;
	  color: #ffffff;
      }
      
      .canvas2d {
	  border: 1px solid white;
	  background-color: black;
      }

      button {
	  font-size: 12px;
	  background-color: #707080;
	  font-weight: bold;
	  color: #ffffc0;
      }

      .buttonBig {
	  font-size: 13px;
      }

      h3 {
	  font-size: 12px;
	  text-align: center;
	  font-weight: bold;
	  padding: 0px;
	  margin: 5px;
      }

      legend {
	  font-size: 12px;
	  font-weight: bold;
	  text-align: center;
      }
      
      fieldset {
	  padding: 5px;
	  margin: 0px;
          border: 1px solid #ffffc0;
         
      }

      table {
	  width: 100%;
	  cellspacing: 0px;
	  cellpadding: 0px;
	  border-collapse: collapse;
      }
      
      th {
	  text-align: left;
	  border: 1px solid white;
	  padding: 2px;
          margin: 0px;
          font-weight: normal;
      }

      td {
	  text-align: right;
	  border: 1px solid white;
	  padding: 2px;
	  margin: 0px;
      }

      .status {
	  font-size: 11px;
	  font-family:monospace;
      }
      
      #buttonPlay {
	  font-size: 16px;
	  min-width: 48px;
	  min-height: 48px;
      }


      /* landscape */
      @media (min-aspect-ratio: 6 / 5) {
	  .control {
	      margin-left: 10px;
	      max-width: 280px;
	      flex-direction: column;
	  }

	  .render {
	      width: 90vh;
	      height: 90vh;
	      display: inline;
	  }

	  th {
	      width: 120px;
	  }
      }

      /* portrait for phone */
      @media (max-aspect-ratio: 6 / 5) and (max-width: 400px) {
	  .control {
	      margin-top: 10px;
	      width: 90vw;
	      flex-direction: row;
	      flex-wrap: wrap;
	  }

	  .render {
	      width: 90vw;
	      height: 90vw;
	      display: block;
	  }

	  .element {
              min-width: 120px;
              max-width: 160px;
  	  }

      }
      /* portrait for larger displays */
      @media (max-aspect-ratio: 6 / 5) and (min-width: 400px) {
	  .control {
	      margin-top: 10px;
	      width: 90vw;
	      flex-direction: row;
	      flex-wrap: wrap;
	  }

	  .render {
	      width: 90vw;
	      height: 90vw;
	      display: block;
	  }

	  .element {
              min-width: 160px;
              max-width: 220px;
  	  }

      }
    </style>
    
    
  </head>
  <body>
    <div class="container">
    <div class="render">
      <canvas id="canvas3d"></canvas>
    </div>
    
    <div class="control">
      <div id="statusBox0" class="element">
	<fieldset><legend>WebDynamica 0.40</legend>
	  <p>
	    <button id="buttonPlay" onclick="window.togglePlay()">â–¶</button>
	    <button id="buttonMinimize" onclick="window.pressMinimize()">Minimize energy</button>
	  </p>
	  <div>
	    <table>
	      <!-- <tr><th>State:</th><td id="tabState" class="center"></td></tr> -->
	      <tr><th>Time (ps):</th><td id="tabTime"></td></tr>
	      <tr><th>Energy (kcal/mol):</th><td id="tabEnergy"></td></tr>
	      <tr><th>Kinetic Temp. (K):</th><td id="tabTemperature"></td></tr>
	    </table>
	  </div>
	  <p>

	    <label for="checkThermostat">Thermostat</label>
	    <input type="checkbox" id="checkThermostat" name="checkThermostat" onclick="toggleThermostat()" />
	    <label for="inputThermostat">Temp.(K)</label>
	    <input type="text" id="inputThermostat" size="3" name="inputThermostat" />
	    <label for="checkShowWater">Show water</label>
	    <input type="checkbox" id="checkShowWater" name="checkShowWater" onclick="toggleShowWater()" />
	  </p>
	</fieldset>
      </div>

      <div id="statusBox1" class="element center">
	<fieldset><legend>Selection</legend>
	  <div id="selectStatus">To move molecule, drag with mouse. Press "F" or "B" to move toward/away. Press "Del" or drag off the viewport to delete.</div>
	  <!-- <div id="selectStatus">To move, drag with mouse. Press "F" or "B" to move toward/away.</div> -->
	  <canvas id="selectCanvas" class="canvas2d" width="80px" height="80px"></canvas>
	  <div><span id="moleculeName">None</span></div>
	  <div id="alternateName">&nbsp;</div>
	</fieldset>
      </div>

      <div id="statusBox2" class="element center">
	<fieldset><legend>Insertion</legend>
	  <canvas id="insertCanvas" class="canvas2d" width="80px" height="80px"></canvas><br>
	  To insert: <span id="insertName">None</span>
	  <p>
	    <button id="buttonPrevious" onclick="window.pressPreviousMolecule()">Prev</button>
	    <button id="buttonNext" onclick="window.pressNextMolecule()">Next</button>
	  </p>
	  <p>
	    <button id="buttonInsert" class="buttonBig" onclick="window.pressInsertMolecule()">Insert</button>
	  </p>
	</fieldset>
      </div>

    </div>
    </div>
    


    <div class="container">
      <p id="status" class="status"></p>
      <p>
	<button id="buttonPDB" onclick="window.pressPDB()">Make PDB</button>
      </p>

      <pre id="pdbData" class="status"></pre>
    </div>
